//import { v4 as uuidv4} from 'uuid';
import { BoxList } from './components/BoxList';
import { SearchBox } from './components/SearchBox';
import { AddBoxForm } from './components/AddBoxForm';

export function App() {
  const [box, setBox] = useState([ {id: 1, title: 'Box 1', content: 'This is just an example of a box, remove it and create yours!', removed: false} ])

  return (
    <Fragment>
      <SearchBox />
      <AddBoxForm />
      <BoxList box={box} />
    </Fragment>
  );
}

export default App;
